import React from "react";
import { ThemeProvider } from "./context/ThemeContext";
import StudyBuddyPlanner from "./components/StudyBuddyPlanner";
import "./App.css";

function App() {
  return (
    <ThemeProvider>
      <div className="App bg-slate-50 dark:bg-gray-900 min-h-screen">
        <StudyBuddyPlanner />
      </div>
    </ThemeProvider>
  );
}

export default App;
